description:
Verenigde Staten / Verenigd Koninkrijk
Drama / Familie
94 minuten

zeer mooie film

met Alison Lohman, Tim McGraw en Maria Bello

Katie leeft op de familieranch in Wyoming. Ze vindt een wild paard, maar haar vader zegt dat ze het beest onmogelijk kan houden. 
Katie wil haar vader bewijzen dat het wel degelijk mogelijk is het dier op te voeden en dat ze ooit de ranch kan overnemen.:
